    <div>
      ss
        <ul className="list">
          {pokemon.map(pokemon => {
            const id = getId(pokemon)
            return (
              <li key={id}>
                <span>{pokemon.results} </span>
                <Link href="/[id]" as={`/${id}`}>
                  <a>View More</a>
                </Link>
              </li>
            )
          })}
        </ul>
    </div>
)

Testpage.getInitialProps = async ({ req }) => {
    const rand = Math.round(Math.random() * (700 - 1) + 1);
    const initialURL = 'https://pokeapico/api/v2/pokemon?offset='+rand+'&limit=30';
    
    const { data, count } = await fetch(initialURL)

   
    return {
      pokemons: data,
      count,
    }
  }
  export default Testpage
